                    <label className = "text-muted">Password</label>
                    <input type ="password" className = "form-control"></input>
                </div>
            </form>
        );
    }
return(
<Layout title ="Sign in Page" discreption = "This is the sign in page for Ecommerce website ">
{creatUi()}
</Layout>
);
}

